import React from 'react';
import {
    Nav,
    NavLink,
    Bars,
    NavMenu
} from './NavbarElements';

class NavBar extends React.Component
{
    render()
    {
        return (
            <>
                <Nav>
                    <Bars />
                    <NavMenu>
                        <NavLink to='/about' activeStyle>
                            About
                        </NavLink>
                    </NavMenu>
                </Nav>
            </>
        );
    }
}

export default NavBar
